Dog Gone comes out TOMORROW on @netflix! This film is so fun and feel good. Who doesn’t love a great dog movie?? It was a hoot to see this last night in a theater with friends and family (including lots of dogs!!). TWO fun facts: I got to meet the real Ginny, the woman my character is based on, and it turns out we have the same birthday!! ❤️❤️ Also, @petals10028 is Gonker’s mommy/trainer, and I’ve known her my whole life because our dads are close friends! So hopefully I’ll get to see Baxter (Gonker) again! ❤️

@johnnyberchtold @roblowe @ashleywilliamsandcompany @sukiyeagley @kevinnealon @netflixfamily

Hair by @theresa_baca m/u by @dahliawarner styling by @jenniferkempwardrobe

Happy International Dog Day from Hoot-n-Annie and ME!!

